import "./HeroStyles.css";
import React from "react";
import Image1 from "../assets/kedarnath.jpeg";
import { Link } from "react-router-dom";
import { TypeAnimation } from "react-type-animation";

const Hero = () => {
  return (
    <div className="hero">
      <div className="mask">
        <img className="intro-image" alt="Kedarnath" src={Image1} />
      </div>
      <div className="content">
        <p>Hi, I am a Traveller !</p>
        <h1>
          <TypeAnimation
            strings={["Developer", "Writer", "Designer"]}
            typeSpeed={100}
            loop
            backSpeed={20}
            cursorChar=">"
            showCursor={true}
            style={{ whiteSpace: "pre-line", fontSize: "2em", color: "white" }}
            repeat={Infinity}
          />
        </h1>

        <div>
          <Link to="/Destinations" className="btn">
            Destinations
          </Link>
          <Link to="/Contact" className="btn btn-light">
            Contact
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Hero;
